import React from 'react'
import Greenbtn from './Greenbtn';
import { GoThreeBars } from "react-icons/go";
import { FaHome, FaTimes } from "react-icons/fa";
import { SiTwitch, SiLinkedin, SiFacebook, SiAboutdotme } from "react-icons/si";
import { useState } from 'react';


const Navbar = () => {

  const [navigation, setNavigation] = useState(false);

  const links = [
    {
      id: 1,
      link: 'home',
    },
    {
      id: 2,
      link: 'services',
    },
    {
      id: 3,
      link: 'about',
    },
    {
      id: 4,
      link: 'support',
    },
    {
      id: 5,
      link: 'pricing'
    }
  ]

  return (
    <div className='w-screen h-20 z-20 fixed bg-gray-900 text-white'>
      <div className='px-3 flex items-center justify-between w-full h-full '>
        <div className='flex items-center'>
          <h1 className='text-4xl font-bold'>Onnn</h1>
        </div>

        <ul className='hidden md:flex'>
          {links.map(({ id, link }) => (
            <li key={id} className='capitalize p-4 cursor-pointer hover:text-lightcolor duration-200'>
              {link}
            </li>
          ))}
        </ul>

        <div className='hidden md:flex mr-4'>
          <Greenbtn title='Sign in' className='px-9 py-3' />
        </div>

        {/*Burger icon*/}
        <div className='md:hidden'>
          <div onClick={() => setNavigation(true)} className='cursor-pointer'>
            <GoThreeBars size={40} />
          </div>
        </div>
        </div>
        
      {/*Mobile menu*/}
      <div className={navigation ? 'md:hodden fixed left-0 top-0 w-full h-full bg-gray-900/70 backdrop-blur' : ''}>
        <div className={navigation ? 'fixed left-0 top-0 w-4/5 h-full bg-gray-900 text-white p-10 ease-in duration-500'
          : 'fixed top-0 left-[-100] h-full p-10 duration-300 ease-in'}>
          <div>
            
          </div>
        </div>
      </div>
    
    </div>
  )
}

export default Navbar
